listing_description:
Superb one bedroom furnished and appointed apartment is nestled in the heart of Braddon, only minutes from Canberra City.

Situated on the first floor, the northerly aspect ensures natural light and warmth during the coming winter months. 

The apartment is furnished and offers a stylish and modern environment.  

Features:
Lounge area with sliding door to north facing balcony;
Spacious kitchen with stainless steel fridge, cooktop, oven and dishwasher, spacious pantry and cupboards, double sink and island bench;
Bathroom with shower, toilet, vanity, IXL Tastic and heated towel rail;
Laundry annex with front loading washing machine and dryer;
Large bedroom with double sliding door robe and north facing windows;
Reverse Cycle air conditioning/heating;
Balcony has privacy planters, outdoor setting and wall garden feature;
One underground parking space and storage cage;
Intercom and security entry;
Well cared for common area gardens.

Owner consent is required for the keeping of pets

EER: There is no existing energy efficiency rating

BOOK AN INSPECTION
1. Click on "BOOK INSPECTION" located under Open Times
2. Register to join an existing inspection
3. If there is no time available or if the time does not suit, please register and we will contact you once further access can be arranged
4. Please note that if you do not register, we cannot notify you of any time changes, cancellations or further inspection times

BOND AND RENT
Bond is equivalent to 4 weeks rent (Bank Cheque or Money Order)
Please note Total Property Management does not accept any cash payments

Disclaimer:
Please not that while all care has been taken regarding general information and marketing information compiled for this rental advertisement, Total Property Management does not accept responsibility and disclaim all liabilities in regard to any errors or inaccuracies contained herein. We encourage prospective tenants to rely on their own investigation and in-person inspections to ensure this property meets their individual needs and circumstances.
